import React, {Component} from 'react';
import CardList from './CardList';
import './App.css';
import {list} from './list.js';

class App extends Component{
	constructor(){
		super();
		this.state = {
			rob: list,
			searchField: ''
		}
	}

	render(){
		return(
			<div>
				<h1>RoboFriends</h1>
				<CardList list = {this.state.rob} />
			</div>
			)
	}
}
export default App;
